This is the video premiere of the Danish psych-rock band @ring_them_bells newest single 'Favorite Gun', filmed in the basement at @warpigs_brewpub_cph, where a dark substance related to the music is resting in the barrels 🤘

@ring_them_bells will be taking over mikkellerbeer on Thursday, 20:00 CET and release some evil and crazy (acoustic) sounds.  They will play simultaneously at our Virtual Bar in Bobs Hytte - limited seating and smoking inside is allowed.

@mikkellermikkel about the collaboration: I love Ring Them Bells because of the noise and their fuck-you-attitude, which hides a lot of  nuances, melody and poetry under the surface That's why it's fun brewing a beer for them and their music. The beer will be black and heavy 🖤

We know that things have been a little silent in the MBCC-camp, but we have been working like crazy on creating the most insane beer festival in 2021 behind the scenes. We are finally at a point now where the last pieces of the puzzle are falling into place, which means we can finally share a ton of information about MBCC 2021 with you all.

Since we know you probably have hundreds of questions for us, we have decided to create a FAQ that should cover the most important things. Feel free to hit us up, if you got some questions after reading through the FAQ.

𝗪𝗶𝗹𝗹 𝗠𝗕𝗖𝗖 𝗵𝗮𝗽𝗽𝗲𝗻 𝘁𝗵𝗶𝘀 𝘆𝗲𝗮𝗿?
We're working hard to make MBCC happen in October (22-23rd) and for it to be the good old familiar (pre-covid) version of the festival. Obviously, there are greater forces at stake but at this point - and with the current vaccine plan and the final restrictions being lifted in the start of October, we are convinced that we can roll out MBCC in October.

